import React, { useState, useEffect} from "react";
import axios from 'axios';


function Findfood () {
  
  //using use state to create JS object
  const [data, setfooddata] = useState({
    foodname: "",
    ishot: "",
  });

  //using use effect to grab data
  useEffect(() =>{
    //using axios to grab from flask server
    axios.get('/food')
      .then(function(response){
        console.log('this is part of useEffect')
        console.log(response)

      })
      .catch(function(error) {
        console.log('something went wrong with axios get food', error)

      })
  
  }, []); 


  const clickFindFood = async () => {
    console.log('the find food btn was clicked');
    await axios.get('/food')
    .then((response) => {
      

      data = response.json();
      console.log('the resonse was...', data);
      

      
    
      const foodput = document.querySelector("#givenfooditem")
      
      console.log('the food is...', data.data)      
      foodput.innerHTML = data;
      return data
    })
    
    .catch((error) => {
      console.error('The fetch operation fucked up', error);
    });
  }

  
  return(
    <>
        <div className="sectionheader">
            <h1>What should we have for dinner?</h1>
        
        </div>

                <div className="fooditem" id="givenfooditem">
                  <p></p>
                </div>

          <div className="button">
            
            <button id="addbtn" onClick={clickFindFood}>Find a food</button>
          </div>
        </>

    )


}

export default Findfood;
